import React from "react";
import s from './Navbar.module.css'
import {NavLink} from 'react-router-dom'
import { useContext } from "react";
import { Context } from "../..";
import {observer} from "mobx-react-lite";



const Navbar=observer(()=>{

const user=useContext(Context)

    return <nav className={s.nav}>
      {user.user.isAuth ? (
        <ul className={s.item}>
          <NavLink to="main" className={navData => navData.isActive ? s.active : s.item}>Главная</NavLink>
          <NavLink to="gum" className={navData => navData.isActive ? s.active : s.item}>Пункты Гум Помощи</NavLink>
          <NavLink to="cha" className={navData => navData.isActive ? s.active : s.item}>Могу помочь</NavLink>
          <NavLink to="nha" className={navData => navData.isActive ? s.active : s.item}>Нужна помошь</NavLink>
          <NavLink to="profil" className={navData => navData.isActive ? s.active : s.item}>Профиль</NavLink>
          <NavLink to="logout" className={navData => navData.isActive ? s.active : s.item}>выйти</NavLink>
        </ul>) :

        (<ul className={s.item}>
          <NavLink to="main" className={navData => navData.isActive ? s.active : s.item}>Главная</NavLink>
          <NavLink to="gum" className={navData => navData.isActive ? s.active : s.item}>Пункты Гум Помощи</NavLink>
          <NavLink to="ch" className={navData => navData.isActive ? s.active : s.item}>Могу помочь</NavLink>
          <NavLink to="nh" className={navData => navData.isActive ? s.active : s.item}>Нужна помошь</NavLink>
          <NavLink to="login" className={navData => navData.isActive ? s.active : s.item}>вход</NavLink>
        </ul>)}
    </nav>
})
        

export default Navbar;
